export const FETCH_LOGIN = 'FETCH_LOGIN';

export const login = () =>{
    let url = "http://127.0.0.1:8000/api/login";
    return async dispatch =>{
        const response = await fetch(url);
        const resData = await response.json();
        let data = resData;

        dispatch({type: FETCH_LOGIN, payLoad: data});  
    }
}
